ny such equipment as may reasonably be required for performing the Services, including (where necessary) adequate computer, voice and data technology and a suitable car (adequately insured for business use). It is the Principal’s responsibility to adequately insure any such equipment as appropriate. \n\n1.9 The Contractor shall not be required to provide any advice and assistance outside the scope of the Services. \n\n1.10 Save to the extent required by the Principal, and subject to arrangements for meetings and liaison, the Contractor will determine the time and place at which to carry out the Services and save as set out in this Agreement neither it nor its Contractor Representatives will be subject to control either by the Principal as to the nature, place, time or manner in which the Services are to be provided. \n\n1.11 The Contractor will comply with the EU Working Time Directive 2003 as implemented in the EU Member State in which the Assignment is carried out by the Contractor engaged on the Services. The Contractor may take holiday at a reasonable time on prior notice. For the avoidance of doubt, the Principal shall have no responsibility in respect of holiday pay for any Contractor. \n\n1.12 The Contractor shall: \n\n(a) comply with all applicable laws, regulations, codes and sanctions relating to anti-bribery and anti-corruption including but not limited to all applicable anti- money laundering, bribery and anti-corruption legislation; \n\n(b) comply with any and all ethics, anti-bribery and anti-corruption policies published by the Principal; \n\n(e) promptly report to the Principal any request or demand for any undue financial or other advantage of any kind received by the Contractor in connection with the performance of the Services; \n\n1.13 Failure to comply with clause 1.12 will result in the termination of this Agreement without notice. \n\n2. Payment \n\n2.1. Subject to satisfactory performance of the Services, the Principal agrees to pay the Contractor for the Services in accordance with the Schedule and the rates specified in the relevant Annex. Payments will be made monthly in arrears to the Contractor within 7 days of receipt by the Principal of a valid and accurate invoice supported by work progress/timesheets (or, where applicable, project reports detailing the work performed together with an analysis of hours spent), signed by the Contractor. \n\n2.2. Payments made will relate to days or proportions of days for which the Services have actually been provided only and no payment will be made by the Principal unless supported by a work progress/timesheet properly completed as instructed by the Principal’s representative and duly approved by such the Principal representative. It is the Contractor’s obligation to procure the approval of and the production to the Principal of work progress/timesheets. \n\n3. Expenses \n\n3.1. The Principal will not reimburse the Contractor for any expenses incurred unless otherwise stated in the Schedule. \n\n4. Duration and Termination \n\n4.1. This Agreement shall remain in force until all Assignments are completed as defined in the relevant Annexes, unless terminated earlier in accordance with the terms of this Agreement or extended by the agreement between the Principal and the Contractor. \n\n4.2. Without prejudice to any other rights and remedies to which the Principal may be entitled under this Agreement, the Principal may terminate this Agreement with immediate effect without notice and without any liability to make any further payment to the Contractor (other than in respect of amounts accrued before the date of such termination) if at any time: \n\n4.2.1 the Contractor commits any serious or repeated breach or non-observance of any of the provisions of this agreement or refuses or neglects to comply with any reasonable and lawful directions of the Principal; \n\n4.2.2 the Contractor is convicted of any criminal offence (other than an offence under any road traffic 